import './App.css';

import React from 'react';
import ReactDOM from 'react-dom';
import { VictoryLine, VictoryChart, VictoryTheme } from 'victory';


const data = [
  {earnings: 13000},
  {earnings: 16500},
  {earnings: 2352},
  {earnings: 2432},
  {earnings: 423424},
  {earnings: 16500},
  {earnings: 234235},
  {earnings: 6464},
  {earnings: 42342},
  {earnings: 1214},
  {earnings: 52255},
  {earnings: 56332}
];



function App() {
  return (
    <div className="App">
      <header className="App-header">
      <VictoryChart
  theme={VictoryTheme.material}
>
  <VictoryLine
    style={{
      data: { stroke: "#c43a31" },
      parent: { border: "1px solid #ccc"}
    }}
    data={[
      { x: 1, y: 2 },
      { x: 2, y: 3 },
      { x: 3, y: 5 },
      { x: 4, y: 4 },
      { x: 5, y: 7 }
    ]}
  />
</VictoryChart>
      </header>
    </div>
  );
}

export default App;
